import React from "react";
import "./button.css"

const InputButton = ({
    text,
    img = "",
    type,
    name,  
    onChange
}) => {
    return (
        <button onClick={onChange}>
            <span className="button-text">{text}</span>
            {img && <img src={img} alt="Button icon" />}
        </button>
    )
}
